import React from "react";

const Turnover = () => {
  return (
    <div className="bg-informationBackground ">
      <div className="mx-auto bg-white max-w-7xl ">
        <div className="flex flex-row p-5 gap-5 border-b border-gray-400 items-center justify-end">
          <button className="bg-common-blue hover:bg-blue-900 rounded-sm text-white text-sm px-10 py-1">চলমান</button>

          <button className="bg-gray-200 rounded-sm hover:bg-gray-400 px-10 text-sm py-1">সম্পন্ন</button>
         
        </div>
        <h3 className="text-center text-black py-4 font-semibold">
        No Pending Ticket Found !
        </h3>
      </div>
    </div>
  );
};

export default Turnover;
